import axios from "axios";
import React, { useState, useEffect } from "react";

const Test = () => {
  let [test, testChange] = useState();

  const getData = async (state, setState) => {
    await axios.get("http://localhost:8181/sample/read").then((result) => {
      setState(result.data);
    });
  };

  useEffect(() => {
    axios.get("http://localhost:8181/sample/read").then((result) => {
      testChange(result.data);
    });
  }, []);

  return (
    <div>
      <p id="one">{test.name}</p>
      <p id="two">{test.age}</p>
      <button
        onClick={async () => {
          await axios
            .post("http://localhost:8181/sample/update", {
              name: test.name,
              age: test.age + 1,
            })
            .then((result) => {
              console.log("update!");
              console.log(result.data);
              testChange(result.data);
            });
        }}
      >
        ajaxUpdate
      </button>
    </div>
  );
};

export default Test;
